"""
Помидорик - приложение управления временем, использующая метод помидора.
Код написан с применением паттерна MVC.

Для создания исполнимого файла .exe под Windows:
pip install Pyinstaller
pyinstaller --onefile -w app.py
"""

import os
import sqlite3
import sys

from datetime import datetime
from PyQt6.QtCore import Qt, QTimer, QUrl
from PyQt6.QtGui import QFont, QIcon
from PyQt6.QtMultimedia import QSoundEffect
from PyQt6.QtWidgets import (
    QPushButton, QApplication, QMainWindow, QVBoxLayout, QWidget, QLabel)


WINDOW_SIZE = 100
# Режимы таймеров в секундах: помидор, короткий и длинный перерывы
# 0 - длительность помидора, 1 - короткого перерыва, 2 - длинного
MODES = {0: 1500, 1: 300, 2: 900}


class PomodorikWindow(QMainWindow):
    """Модель отображения"""
    def __init__(self, pomodoriks, seconds, width, height):
        super().__init__()

        # Задание расположения на мониторе и размеры окна
        self.setGeometry(
            int(width - height * 0.11),
            int(height - width * 0.1),
            WINDOW_SIZE, WINDOW_SIZE)

        # Цвета фона и шрифта главного окна
        self.setStyleSheet("background-color: black;"
                           "color: green;")
        # прозрачность окна
        self.setWindowOpacity(0.5)

        # флаги уставновки окна поверх других и
        # флаг уставноки только кнопки закрытия
        self.setWindowFlags(Qt.WindowType.WindowStaysOnTopHint |
                            Qt.WindowType.WindowCloseButtonHint)

        # название и иконка приложения
        self.setWindowTitle('Pomodorik')
        self.setWindowIcon(QIcon("pomodoro.ico"))

        # создание виджетов
        self._createView(seconds, pomodoriks)

    def _createView(self, seconds, pomodoriks):
        # timer object
        self.timer = QTimer()
        # Запуск таймера на 1 секунду
        self.timer.start(1000)

        # sound effect
        self.effect = QSoundEffect()
        self.effect.setSource(QUrl.fromLocalFile('sound.wav'))

        # central widget
        self.centralWidget = QWidget()
        self.setCentralWidget(self.centralWidget)

        # layaout manager
        self.generalLayout = QVBoxLayout()
        self.generalLayout.setAlignment(Qt.AlignmentFlag.AlignCenter)
        self.centralWidget.setLayout(self.generalLayout)

        # timer label
        self.timeLabel = QLabel(f'{seconds // 60:02}:{seconds % 60:02}')
        self.timeLabel.setFont(QFont('Arial', 15))
        self.timeLabel.setAlignment(Qt.AlignmentFlag.AlignCenter)
        self.generalLayout.addWidget(self.timeLabel)

        # start/stop button
        self.button = QPushButton('Start')
        self.button.setFont(QFont('Arial', 12))
        self.generalLayout.addWidget(self.button)

        # pomodorik label
        self.pomodoriksLabel = QLabel(str(pomodoriks))
        self.pomodoriksLabel.setFont(QFont('Arial', 15))
        self.pomodoriksLabel.setAlignment(Qt.AlignmentFlag.AlignCenter)
        self.generalLayout.addWidget(self.pomodoriksLabel)

    def startStopButton(self, status):
        """Обработка кнопки старт/стоп"""
        if status:  # нажитие паузы
            self.button.setText('Start')
            self.button.setStyleSheet("color: green")
        else:  # нажатие старта
            self.button.setText('Stop')
            self.button.setStyleSheet("color: red")

    def printTime(self, seconds):
        # вывести текущее показание таймера
        self.timeLabel.setText(f'{seconds // 60:02}:{seconds % 60:02}')

    def playSoundNote(self):
        """возпроизведение звукового оповещения"""
        self.effect.play()

    def setFullNormalScreen(self, mode):
        """Установка окна приложения во весь экран или в начальные размеры"""
        if mode:
            # нормализация экрана, если закончился перерыв
            self.showNormal()
        else:
            # во весь экран при окончании помидорика
            self.showFullScreen()

    def changePomdorikLabel(self, pomodoriks):
        """Вывод количества законченных помидоров"""
        self.pomodoriksLabel.setText(str(pomodoriks))

    def showTime(self, func):
        func()


class PomodorikModel:
    """Модель данных"""
    def __init__(self) -> None:
        self._createDB()  # создание базы данных если её нет
        self.date = datetime.now().strftime('%Y%m%d')  # текущий день
        self.mode = 0  # режим таймера
        self.seconds = MODES[self.mode]  # секунды таймера
        self.pomodoriks = self._getPomodoriks()  # кол-во помидоров
        self.status = False  # статус таймера - старт - True/стоп - False

    def _createDB(self):
        """Создание базы данных, если её нет"""
        self._connectDB()
        self.cursor.execute('''
        create table if not exists pomodoriks (
            date date primary key,
            count integer
            )
                       ''')
        self._disconnectDB()

    def _setPomodoriks(self):
        """Записать помидоры в файл"""
        self._connectDB()
        rqst = 'update pomodoriks set count = ? where date = ?'
        self.cursor.execute(rqst, (self.pomodoriks, self.date))
        self._disconnectDB()

    def _getPomodoriks(self):
        """Получить помидоры из файла"""
        self._connectDB()

        # запрос записи о количествах помидоров за текущий день
        rqst_slct = 'select count from pomodoriks where date = ?'
        self.cursor.execute(rqst_slct, (self.date,))
        data = self.cursor.fetchone()
        if not data:
            # если записи текущего дня нет, то вставить в таблицу
            rqst_insrt = 'insert into pomodoriks (date, count) values (?, ?)'
            self.cursor.execute(rqst_insrt, (self.date, 0))
            pomodoriks = 0
        else:
            pomodoriks = data[0]

        self._disconnectDB()
        return pomodoriks

    def _connectDB(self):
        """Подключение к базе данных"""
        self.conn = sqlite3.connect('pomodoriks.db')
        self.cursor = self.conn.cursor()

    def _disconnectDB(self):
        """Отключение от базы данных"""
        self.conn.commit()
        self.conn.close()

    def changeStatus(self):
        """Изменение статуса таймера"""
        if self.status:
            self.status = False
        else:
            self.status = True

    def decreaseTimer(self):
        """Уменьшение секунд на 1"""
        self.seconds -= 1

    def updateSeconds(self):
        """Обновить секунды согласно режиму таймера"""
        self.seconds = MODES[self.mode]

    def breakHandler(self):
        """Обработка окончания перерывов"""
        # перевести в режим помидорика
        self.mode = 0
        # обновление записи в базе данных
        self._setPomodoriks()

    def pomodorikHandler(self):
        """Обработка окончания помодорика"""
        # инкриментировать помидоры
        self.pomodoriks += 1

        # после каждого 4 помидора - long_break
        if self.pomodoriks % 4 == 0:
            self.mode = 2
        else:
            # short_break
            self.mode = 1


class PomodorikController:
    """Контроллер связывающий модель и отображение данных"""
    def __init__(self, model: PomodorikModel, window: PomodorikWindow):
        self._model = model
        self._window = window
        self._connectSignalsSlots()

    def _connectSignalsSlots(self):
        """Стыковка сигналов и слотов"""
        # привязка сигнала от кнопки старт/стоп к функции её обработки
        self._window.button.clicked.connect(self._startStopHandler)
        # сигнал окончания 1-сек. таймера к функции отрисовки времени
        self._window.timer.timeout.connect(lambda: self._showTime())

    def _startStopHandler(self):
        """Обработка кнопки старт/стоп"""
        # отрисовка кнопки в зависимости от статуса
        self._window.startStopButton(self._model.status)
        # инверсия статуса при нажатии кнопки
        self._model.changeStatus()

    def _showTime(self):
        """Вывод оставшегося времени"""
        # выйти из функции при статусе таймера False
        if not self._model.status:
            return

        # уменьшить секунды на 1
        self._model.decreaseTimer()

        # если таймер закончился
        if self._model.seconds == 0:
            # включить звуковое оповещение
            self._window.playSoundNote()
            # блокировать и разблокировать экран
            self._window.setFullNormalScreen(self._model.mode)
            # обработать окончания любого таймера
            self._modeHandler()
            # обновить секунды таймера
            self._model.updateSeconds()

        # вывести время таймера
        self._window.printTime(self._model.seconds)

    def _modeHandler(self):
        """Обработка окончания любого из режимов таймера"""
        # если закончился помидорик
        if self._model.mode == 0:
            # обработать в модели
            self._model.pomodorikHandler()
            # вывести помидоры
            self._window.changePomdorikLabel(self._model.pomodoriks)
        else:
            # обработать в модели
            self._model.breakHandler()
            # остановить вывод таймера и переоформить кнопку
            self._startStopHandler()


